import React, { Component } from 'react'
import "./css/styles.css";
import "./css/w3schools.css";

export default class AboutMe extends Component {
  render() {
    return (
      <div>
      <h3 class="main montserrat large"> ABOUT ME </h3>
      <p class="main montserrat medium">This is where I'll put stuff about me and what I want hahah. Like a whole paragraph but hopefully this will look good just doing my thing. This is me writing more so it goes on the next line but I'll have to decide what to put here.</p>

      </div>
    )
  }
}
